import React from 'react';
import '../../css/submenu/SettingsMenu.css';

class SettingsMenu extends React.Component {
    constructor(props) {
        super(props);
    }


    render() {
        return (

            <div className="SettingsMenu">
                <p style={{ fontWeight: "bold" }}>USER</p>
                <p>Test-o-tron</p>
                <div className="BtnContainer">
                    <div className="SubmenuBtn">About</div>
                    <div className="SubmenuBtn" onClick={this.props.changeSubmenuState}>Unlink Account</div>
                    <div className="SubmenuBtn" onClick={this.props.changeSubmenuState}>Delete User</div>
                </div>
            </div>

        );
    }
}

export default SettingsMenu;
